def minion_game(string):
    string = string.upper()
  
    ####stringX.count('a')
    def ke(string):
        AEIOU = ["A","E","I","O","U"] # in
        vetor = list(set([l for l in list(set(string)) if l in AEIOU]))

        print(vetor)
        testes = []
        tamanho = len(string)
        for tam in range(1,tamanho+1):
            for letra_vetor in vetor:
                for k,letra_string in enumerate(string):
                    if letra_vetor == letra_string:
                        add = string[k:k+tam]
                        if len(add)==tam:
                            testes.append(add)

        return len(testes)
    
        
    def st(string):
        CONSOANTES = ["B","C","D","F","G","H","J","K","L","M","N","P","Q","R","S","T","V","X","W","Y","Z"]
